import React from 'react';

const Navbar = () => {
    return(
        <nav className="nav-wrapper blue     darken-3">
            <div className="container">
                <a href="#" className="brand-logo">Directory App</a>
                <ul className="right">
                    <li><a href='#'>Home</a></li>
                    <li><a href='#'>About Us</a></li>
                    <li><a href='#'>Contact Us</a></li>
                </ul>
            </div>
        </nav>
    )
}

export default Navbar
